import React from "react";
import sdata from "./Sdata.jsx";
import Card from "./Card.jsx";

function Ncard(val) {
  return (
    <Card
      key={val.id}
      src={val.src}
      title={val.title}
      details={val.details}
      link={val.link}
    />
  );
}

const Netflix = () => {
  return <>
  sdata.map(Ncard); </>
};

export default Netflix;
